import React, { Component } from 'react'
import data from '../mydata';

export default class Introduction extends Component {
    render() {
        return (
            <div className="child">
                <p>Lorem ipsum dolor sit amet, consectetur adipiscing elit. Maecenas sollicitudin cursus odio, sit amet ultricies arcu. Orci varius natoque penatibus et magnis dis parturient montes, nascetur ridiculus mus. Morbi eu tincidunt erat, facilisis semper nibh. Donec posuere lacinia ipsum, ac pellentesque lectus euismod vitae. Vivamus sed ex lectus. Nam fermentum a ante a cursus. Donec et erat ut dui gravida placerat at et lorem. Phasellus commodo purus eu vestibulum posuere. Aenean fermentum urna arcu, quis finibus sapien malesuada id. Suspendisse finibus metus a nisl viverra cursus. Duis id justo tincidunt, ultrices leo sit amet, lacinia eros. Morbi condimentum ex ipsum, vitae egestas orci dapibus id. Vestibulum auctor ligula urna, ac hendrerit ipsum sagittis id.

                    Aenean vitae velit diam. Vivamus ac lacus nibh. Donec sed libero auctor, pharetra velit ac, convallis diam. Morbi sapien eros, rutrum sed orci at, vulputate dapibus massa. Mauris sed neque hendrerit, porta dolor et, mattis tortor. Suspendisse pulvinar lectus ante, non suscipit elit viverra quis. Cras sit amet laoreet arcu. Fusce laoreet gravida ultricies. Morbi eu mi sed arcu fermentum facilisis. Nulla id malesuada sem, eu tempor sem. In vitae laoreet est, non gravida tortor. Sed iaculis interdum ipsum, non aliquet magna pharetra id. Aenean ullamcorper hendrerit sapien eget hendrerit.

                    Nullam mi sem, pulvinar vitae dui a, tempor molestie justo. Ut ultrices neque eget nulla egestas, sed lacinia dolor pulvinar. Sed rhoncus scelerisque nisl non interdum. Donec sed ullamcorper lacus, vitae semper velit. Praesent cursus est nec lectus aliquam laoreet. Quisque a sem venenatis, sodales metus nec, molestie lacus. Nullam auctor congue consequat. Suspendisse potenti. Integer cursus pellentesque tristique. Morbi arcu neque, imperdiet quis ante vitae, sodales lacinia lorem. Etiam interdum egestas leo lobortis scelerisque.</p>
            </div>
        )
    }
}
